/*
Author: Ted Jenks

React-Native component to serve as a portal for the entry of personal details
on signing up to the service.
 */

//------------------------------------------------------------------------------

/* IMPORTS */

// React imports
import React, {Component} from 'react';
import {
  Alert,
  Image,
  Pressable,
  ScrollView,
  Text,
  TextInput,
  View,
} from 'react-native';

// Local imports
import styles, {ICON_DARK} from '../../../style/styles';
import {IdentityManager} from '../../../tools/identityManager';
import CustomButton from '../../generic/customButton';
import Section from '../../generic/section';
import NavButton from '../../generic/navButton';

// Third party packages
import {launchCamera} from 'react-native-image-picker';
import * as Keychain from 'react-native-keychain';
const fetch = require('node-fetch');
const formData = require('form-data');
const Web3 = require('web3');
import Icon from 'react-native-vector-icons/MaterialIcons';

// Global constants
import {BLOCKCHAIN_URL} from '@env';
import NavBar from '../navBar';
import DatePicker from './datePicker'; // update
console.log('Enter Details: ', BLOCKCHAIN_URL); //
const web3 = new Web3(BLOCKCHAIN_URL);

//------------------------------------------------------------------------------

/* BODY */

class EnterDetails extends Component {
  state = {
    data: {
      personal: ['', ''],
      nationality: ['', ''],
      address: ['', '', '', ''],
    }, // data entered by user
    dob: null,
    expiry: null,
    documentImageData: null,
    photoData: null,
    pageCount: 0,
    address: null,
  };

  constructor() {
    super();
  }

  incompleteAlert = () =>
    // show alert informing user that the form is not complete
    Alert.alert(
      'FORM NOT COMPLETE',
      'Please enter all necessary information to continue',
      [{text: 'OK', onPress: () => console.log('OK Pressed')}],
    );

  checkComplete = () => {
    // check that the form has been completed
    for (const datum in this.state.data) {
      for (const item of datum) {
        if (item == '') {
          return false;
        }
      }
    }
    if (this.state.photoData == null || this.state.documentImageData == null) {
      console.log(this.state.documentImageData);
      return false;
    }
    return true;
  };

  checkPageComplete = title => {
    // check that the form has been completed
    if (title != 'image' && title != 'document') {
      for (const item of this.state.data[title]) {
        if (item == '') {
          return false;
        }
      }
    }
    if (title === 'image' && this.state.photoData === null) {
      return false;
    }
    if (
      title === 'document' &&
      (this.state.documentImageData === null || this.state.expiry === null)
    ) {
      return false;
    }
    if (title === 'personal' && this.state.dob === null) {
      return false;
    }
    return true;
  };

  sendDataToServer = () => {
    // address of server for sign-up
    const url = this.props.url;
    const headers = {
      Accept: 'application/json',
    };
    // create formData object to send via https
    const form = new formData();
    form.append('Content-Type', 'application/octet-stream');
    form.append('name', this.state.data.personal[0]);
    form.append('dob', this.state.dob);
    form.append('pob', this.state.data.nationality[1]);
    form.append('expiry', this.state.expiry);
    form.append('house', this.state.data.address[0]);
    form.append('street', this.state.data.address[1]);
    form.append('city', this.state.data.address[2]);
    form.append('postcode', this.state.data.address[3]);
    form.append('sex', this.state.data.personal[1]);
    form.append('nationality', this.state.data.nationality[0]);
    form.append('bc_address', this.state.address);
    form.append('image', this.state.photoData, 'base64');
    form.append('doc', this.state.documentImageData, 'base64');
    // make https put request
    fetch(url, {method: 'POST', headers: headers, body: form})
      .then(data => {
        console.log(data);
      })
      .catch(err => {
        console.log(err);
      });
  };

  tedImageOne = () => {
    // dev tool for quickly filling in form during development
    this.setState({
      photoData:
        '',
    });
  };

  tedImageTwo = () => {
    // dev tool for quickly filling in form during development
    this.setState({
      photoData:
        '',
    });
  };

  createAccount = async () => {
    // generate account and key on BC
    const modelAccount = web3.eth.accounts.create();
    console.log('Modelling on: ', modelAccount);
    const account = {
      address: modelAccount.address,
      privateKey: modelAccount.privateKey,
    };
    return account;
  };

  saveAccountToKeychain = async account => {
    // save BC account information in keystore
    await Keychain.setGenericPassword(account.address, account.privateKey);
  };

  writeDataToRealm = () => {
    const account = this.createAccount() // generate account
      .then(account => {
        console.log('Account generated: ', account);
        this.saveAccountToKeychain(account).catch(e => console.log(e)); // save account locally
        this.setState({address: account.address});
        const identityManager = new IdentityManager(); // open instance of realm to save to
        console.log('writing...');
        identityManager
          .storeID(
            // save data to realm
            this.state.data.personal[0],
            this.state.dob,
            this.state.data.nationality[1],
            this.state.expiry,
            this.state.data.address[0],
            this.state.data.address[1],
            this.state.data.address[2],
            this.state.data.address[3],
            this.state.data.personal[1],
            this.state.data.nationality[0],
            this.state.photoData,
            account.address,
          )
          .then(r => {
            // update the display
            this.props.onSubmit();
            // send data to sign up server
            this.sendDataToServer();
          })
          .catch(e => console.log(e));
      });
  };

  handleNextPage = () => {
    let currentPage = this.state.pageCount;
    currentPage++;
    this.setState({pageCount: currentPage});
  };

  handlePrevPage = () => {
    let currentPage = this.state.pageCount;
    currentPage--;
    this.setState({pageCount: currentPage});
  };

  handleDobComplete = dob => {
    this.setState({dob});
  };

  handleExpiryComplete = expiry => {
    this.setState({expiry});
  };

  handleAutofill = () => {
    // dev tool for quickly filling in form during development
    this.setState({
      data: {
        personal: ['Edward C Jenks', 'Male'],
        nationality: ['United Kingdom', 'London'],
        address: ['22a', 'Greswell Street', 'London', 'SW6 6PP'],
      },
      dob: '2000-06-01',
      expiry: '2028-01-01',
      documentImageData:
        '',
      photoData:
// ''
        '',
    });
  };

  handleSubmit = () => {
    if (this.checkComplete()) {
      // write data to file and then submit
      this.writeDataToRealm();
    } else {
      console.log('Form not complete');
      this.incompleteAlert();
    }
  };

  handleLaunchCameraDirection = (direction, field) => {
    // launch camera and save the photo
    let options = {
      mediaType: 'photo',
      includeBase64: true,
      cameraType: direction,
      quality: 0.3,
      maxHeight: 800,
      maxWidth: 800,
    };

    launchCamera(options, response => {
      // console.log('Response = ', response);
      if (response.didCancel) {
        console.log('User cancelled image picker');
      } else if (response.error) {
        console.log('ImagePicker Error: ', response.error);
      } else {
        console.log(response.assets[0].base64);
        // successful image collection
        if (field === 'photoData') {
          this.setState({
            photoData: response.assets[0].base64,
          });
        } else {
          this.setState({
            documentImageData: response.assets[0].base64,
          });
        }
      }
    }).catch(e => console.log('Unhandled camera exception: ', e));
  };

  formFromFields = (fields, dataKey) => {
    return (
      <View>
        {this.state.data[dataKey].map((value, key) => (
          <TextInput
            style={styles.input}
            key={key}
            label={fields[key]}
            mode="outlined"
            placeholder={fields[key]}
            placeholderTextColor={'#c1c1d5'}
            value={value}
            onChangeText={res => {
              let newData = this.state.data;
              newData[dataKey][key] = res;
              this.setState({data: newData});
            }}
            ref={input => {
              this.name = input;
            }}
          />
        ))}
      </View>
    );
  };

  dataEntryForm = (
    fields,
    title,
    description,
    first = false,
    final = false,
    imageElement = null,
  ) => {
    return (
      <ScrollView
        style={{flex: 1}}
        contentContainerStyle={{flexGrow: 1}}
        keyboardShouldPersistTaps="handled">
        <View>
          <Section title={title}>{description}</Section>
          {!final &&
            title !== 'Document' &&
            this.formFromFields(fields, title.toLowerCase())}
          {imageElement}
        </View>
        <View style={styles.buttonContainer}>
          {!final && (
            <NavButton
              text={'NEXT'}
              onPress={this.handleNextPage}
              onLongPress={this.handleAutofill}
              pressable={this.checkPageComplete(title.toLowerCase())}
            />
          )}
          {final && (
            <NavButton
              text={'SUBMIT'}
              onPress={this.handleSubmit}
              pressable={this.checkPageComplete(title.toLowerCase())}
            />
          )}
        </View>
      </ScrollView>
    );
  };

  personalDataEntry = () => {
    return this.dataEntryForm(
      ['Name', 'Sex'],
      'Personal',
      'Please enter your personal information as it appears on your' +
        ' document below.',
      true,
      false,
      <View>
        <Text
          style={[
            styles.sectionDescription,
            {paddingLeft: 25, paddingBottom: 0, marginBottom: 0},
          ]}>
          Date of Birth:
        </Text>
        <DatePicker onComplete={this.handleDobComplete} date={this.state.dob} />
      </View>,
    );
  };

  nationalityDataEntry = () => {
    return this.dataEntryForm(
      ['Nationality', 'Place of Birth'],
      'Nationality',
      'Please enter your nationality information as it appears on your' +
        ' document below',
    );
  };

  addressDataEntry = () => {
    return this.dataEntryForm(
      ['House', 'Street', 'City', 'Postcode'],
      'Address',
      'Please enter your address as it appears on your document below.',
    );
  };

  documentDataEntry = () => {
    return this.dataEntryForm(
      [],
      'Document',
      'Please enter your document expiry date and upload a photo of your' +
        ' document.',
      false,
      false,
      <View style={{padding: 10}}>
        <View>
          <Text
            style={[
              styles.sectionDescription,
              {paddingLeft: 25, paddingBottom: 0, marginBottom: 0},
            ]}>
            Document Expiry:
          </Text>
          <DatePicker
            onComplete={this.handleExpiryComplete}
            startYear={new Date().getFullYear()}
            endYear={new Date().getFullYear() + 30}
            date={this.state.expiry}
          />
        </View>
        {this.state.documentImageData === null && (
          <Pressable
            style={[styles.navButton, {flexDirection: 'row'}]}
            onPress={() =>
              this.handleLaunchCameraDirection('front', 'document')
            }
            android_ripple={{color: '#fff'}}>
            <Icon name="camera-alt" size={25} color="#ffffff" />
            <Text style={[styles.navButtonText, {marginLeft: 5}]}>
              TAKE PHOTO
            </Text>
          </Pressable>
        )}
        {!(this.state.documentImageData === null) && (
          <View style={{alignItems: 'center'}}>
            <View style={{width: '80%', alignItems: 'center'}}>
              <Image
                source={{
                  uri: 'data:image/jpeg;base64,' + this.state.documentImageData,
                }}
                style={styles.photo}
              />
            </View>
            <Pressable
              onPress={() =>
                this.handleLaunchCameraDirection('front', 'document')
              }
              android_ripple={{color: '#fff'}}>
              <Text style={[styles.clickableText]}>RETAKE</Text>
            </Pressable>
          </View>
        )}
      </View>,
    );
  };

  imageDataEntry = () => {
    return this.dataEntryForm(
      [],
      'Image',
      'Please take a photo of your face. You must not wear glasses or ' +
        'obstruct your face in any way. Makeup must not be worn and hair must ' +
        'be tied back. The photo should be taken around 50cm away at eye ' +
        'level with your face in the center if the image. Do not smile or ' +
        'make any other expressions. ' +
        '\n\n' +
        'Failure to comply with these restrictions will result in your ' +
        'account being rejected.',
      false,
      true,
      <View style={{padding: 10}}>
        {this.state.photoData === null && (
          <Pressable
            style={[styles.navButton, {flexDirection: 'row'}]}
            onPress={() =>
              this.handleLaunchCameraDirection('back', 'photoData')
            }
            android_ripple={{color: '#fff'}}>
            <Icon name="camera-alt" size={25} color="#ffffff" />
            <Text style={[styles.navButtonText, {marginLeft: 5}]}>
              TAKE PHOTO
            </Text>
          </Pressable>
        )}
        {!(this.state.photoData === null) && (
          <View style={{alignItems: 'center'}}>
            <View style={{width: '80%', alignItems: 'center'}}>
              <Image
                source={{
                  uri: 'data:image/jpeg;base64,' + this.state.photoData,
                }}
                style={styles.photo}
              />
            </View>
            <Pressable
              onPress={() =>
                this.handleLaunchCameraDirection('back', 'photoData')
              }
              android_ripple={{color: '#fff'}}>
              <Text style={[styles.clickableText]}>RETAKE</Text>
            </Pressable>
          </View>
        )}
      </View>,
    );
  };

  render() {
    const pages = [
      this.personalDataEntry,
      this.nationalityDataEntry,
      this.addressDataEntry,
      this.documentDataEntry,
      this.imageDataEntry,
    ];
    return (
      <View
        style={{
          height: '100%',
        }}>
        <NavBar
          pageCount={this.state.pageCount}
          onPress={this.handlePrevPage}
          onPress1={this.props.onBack}
          onLongPress={this.handleAutofill}
        />
        {pages[this.state.pageCount]()}
      </View>
    );
  }
}

//------------------------------------------------------------------------------

/* EXPORTS */

export default EnterDetails;
